import { NavLink } from 'react-router-dom';
const home = () => {
    return (
        <div className="page">
        <div className="container">
           <div className="child">

         <NavLink className="navL" to="/about">About</NavLink>
      </div>
      
      </div>
     
      </div>
    );
}
 
export default home;
